import React, { useState, useEffect } from 'react';
import axios from 'axios';
import {
  LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend,
  PieChart, Pie, Cell, ResponsiveContainer
} from 'recharts';
import './AdminPortal.css';

const AdminPortal = () => {
  const [logs, setLogs] = useState([]);
  const [stats, setStats] = useState({});
  const [loading, setLoading] = useState(true);
  const [animate, setAnimate] = useState(false);

  useEffect(() => {
    fetchLogs();
    // Start animation after data is loaded
    setTimeout(() => setAnimate(true), 100);
    // Refresh logs every 30 seconds
    const interval = setInterval(fetchLogs, 30000);
    return () => clearInterval(interval);
  }, []);

  const fetchLogs = async () => {
    try {
      const response = await axios.get('http://localhost:5002/admin/logs');
      setLogs(response.data.logs);
      setStats(response.data.stats);
      setLoading(false);
    } catch (error) {
      console.error('Error fetching logs:', error);
    }
  };

  // Prepare data for charts
  const prepareTimeSeriesData = () => {
    const timeData = logs.reduce((acc, log) => {
      const hour = new Date(log.timestamp).getHours();
      acc[hour] = (acc[hour] || 0) + 1;
      return acc;
    }, {});

    return Object.entries(timeData).map(([hour, count]) => ({
      hour: `${hour}:00`,
      count
    }));
  };

  const preparePieChartData = () => [
    { name: 'Attacks', value: stats.attacks || 0 },
    { name: 'Transactions', value: stats.transactions || 0 }
  ];

  const COLORS = ['#FF6B6B', '#4ECDC4'];

  return (
    <div className={`admin-portal ${animate ? 'animate' : ''}`}>
      <div className="header">
        <h1>Admin Dashboard</h1>
        <div className="refresh-button" onClick={fetchLogs}>
          <i className="fas fa-sync-alt"></i>
        </div>
      </div>

      {loading ? (
        <div className="loading">
          <div className="loader"></div>
          <p>Loading dashboard data...</p>
        </div>
      ) : (
        <>
          <div className="stats-cards">
            <div className="stat-card">
              <div className="stat-icon">üìä</div>
              <h3>Total Logs</h3>
              <p className="stat-number">{stats.total_logs}</p>
              <div className="stat-indicator"></div>
            </div>
            <div className="stat-card warning">
              <div className="stat-icon">‚ö†Ô∏è</div>
              <h3>Attacks Detected</h3>
              <p className="stat-number">{stats.attacks}</p>
              <div className="stat-indicator"></div>
            </div>
            <div className="stat-card success">
              <div className="stat-icon">‚úÖ</div>
              <h3>Transactions</h3>
              <p className="stat-number">{stats.transactions}</p>
              <div className="stat-indicator"></div>
            </div>
          </div>

          <div className="charts-container">
            <div className="chart-card">
              <h2>Activity Timeline</h2>
              <ResponsiveContainer width="100%" height={300}>
                <LineChart data={prepareTimeSeriesData()}>
                  <CartesianGrid strokeDasharray="3 3" stroke="#2c3e50" opacity={0.1} />
                  <XAxis dataKey="hour" stroke="#718096" />
                  <YAxis stroke="#718096" />
                  <Tooltip 
                    contentStyle={{ 
                      backgroundColor: '#1a202c',
                      border: 'none',
                      borderRadius: '8px',
                      color: '#fff'
                    }}
                  />
                  <Legend />
                  <Line 
                    type="monotone" 
                    dataKey="count" 
                    stroke="#4ECDC4"
                    strokeWidth={2}
                    dot={{ stroke: '#4ECDC4', strokeWidth: 2 }}
                    activeDot={{ r: 8 }}
                  />
                </LineChart>
              </ResponsiveContainer>
            </div>

            <div className="chart-card">
              <h2>Activity Distribution</h2>
              <ResponsiveContainer width="100%" height={300}>
                <PieChart>
                  <Pie
                    data={preparePieChartData()}
                    cx="50%"
                    cy="50%"
                    labelLine={false}
                    outerRadius={80}
                    fill="#8884d8"
                    dataKey="value"
                    animationBegin={0}
                    animationDuration={1500}
                  >
                    {preparePieChartData().map((entry, index) => (
                      <Cell key={`cell-${index}`} fill={COLORS[index % COLORS.length]} />
                    ))}
                  </Pie>
                  <Tooltip 
                    contentStyle={{ 
                      backgroundColor: '#1a202c',
                      border: 'none',
                      borderRadius: '8px',
                      color: '#fff'
                    }}
                  />
                  <Legend />
                </PieChart>
              </ResponsiveContainer>
            </div>
          </div>

          <div className="logs-section">
            <h2>Recent Activity Logs</h2>
            <div className="logs-table-container">
              <table className="logs-table">
                <thead>
                  <tr>
                    <th>Timestamp</th>
                    <th>Type</th>
                    <th>Message</th>
                    <th>Status</th>
                  </tr>
                </thead>
                <tbody>
                  {logs.slice(-10).map((log, index) => (
                    <tr 
                      key={index} 
                      className={`log-row ${log.type === 'XSS Attack' ? 'attack-log' : ''}`}
                      style={{ animationDelay: `${index * 0.1}s` }}
                    >
                      <td>{new Date(log.timestamp).toLocaleString()}</td>
                      <td>
                        <span className={`log-type ${log.type.toLowerCase().replace(' ', '-')}`}>
                          {log.type}
                        </span>
                      </td>
                      <td>{log.message}</td>
                      <td>
                        <span className={`status-badge ${log.type === 'XSS Attack' ? 'error' : 'success'}`}>
                          {log.type === 'XSS Attack' ? 'Alert' : 'Normal'}
                        </span>
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
        </>
      )}
    </div>
  );
};

export default AdminPortal;
